%[text] %[text:anchor:T_01D54C26] # Convolution (and upsampling)
%[text] This function implements a disrete convolution between a symbol stream and the impulse response of the TX filter (i.e., the pulse shape). To do so, the symbol stream is first upsampled in order to match the sampling rate defined by the pulse IR, and then the discrete convolution is performed).
%[text] <u>**Inputs:**</u>
%[text] - *symb\_TX*: complex symbol stream vector of size *nb\_symb x 1* where *nb\_symb =* length( *symb\_TX* )
%[text] - *g*: Impulse Response (IR) of the pulse of size *1 x* length( *g* )
%[text] - *sps*: number of samples per symbol  \
%[text] <u>**Ouput:**</u>
%[text] - *signal*: result of the convolution, vector of size *\[ ( nb\_symb - 1 ) \* sps + length( g ) \] x 1* \
function signal = convolution_TX( symb_TX , g , sps )
%[text:tableOfContents]{"heading":"**Table of Contents**"}
%[text] %[text:anchor:H_1AFC0337] ## Upsampling
%[text] In order to match the sampling rate used to design the filter impulse response *g*, the symbol vector *symb\_TX* must first be upsampled as illustrated below (zero-padding):
%[text] ![symbols.png](text:image:8f30)
% Code the upsampling here
nb_symb = length( symb_TX );
nb_sample = nb_symb*sps - sps + 1;
UPsymb_TX = zeros(nb_sample,1);

for i=1:nb_symb
    UPsymb_TX( (i-1)*sps + 1 ) = symb_TX(i);
end

%[text] %[text:anchor:H_96DA3149] ## Discrete Convolution
%[text] The discrete convolution between the upsampled symbol stream $ s\_{up}$ and the filter Impulse Response (IR) $g$ is defined as $\\left( s\_{up} \* g \\right)\[n\]=\\sum\_{l=-\\infty}^{+\\infty}s\_{up}\[n-l\]g\[l\]$. In our case, $g$ represents the filter Impulse Response (IR) which is finite (FIR filter). So the convolution can be written as a finite summation: 
%[text] $\\left( s\_{up} \* g \\right)\[n\]=\\sum\_{l=-L}^{L}s\_{up}\[n-l\]g\[l\]$
%[text] with $n \\in \[1 : nb\_{sample}\]$ and $2L+1${"editStyle":"visual"} is the number of samples of the filter IR.
%[text]  To implement this finite summation in Matlab, a special care to vector indexes should be observed. Indeed, Matlab does not handle negative indexes. So the summation should be coded as:
%[text] $\\left( s\_{up} \* g \\right)\[n\]=\\sum\_{l=-L}^{L}s\_{up}\[n-l\]g\[l+L+1\]$
%[text] An issue also raises when:
%[text] - $n\\leq l$: indexes become negative in $ s\_{up}$ 
%[text] - $n - l\>nb\_{sample}$: indexes exceed the number of elements in $ s\_{up}$ \
%[text]  To avoid that, it is possible to fill the $ s\_{up}$ vector with $2L${"editStyle":"visual"} zeros at the begining and $2L${"editStyle":"visual"} zeros at the end such as:
%[text] $ s^{filled}\_{up}=\[ 0\~\\cdots\~0\~s\_{up}\~0\~\\cdots\~0\]$. The convolution to implement becomes then:
%[text] $\\left(  s^{filled}\_{up} \* g \\right)\[n\]=\\sum\_{l=-L}^{L} s^{filled}\_{up}\[n-l\]g\[l+L+1\]$
%[text] with $n \\in \[L+1 : nb\_{sample}+3L\]$.
% Code the discrete convolution here
Lg = length(g);
L = (Lg-1)/2;
UPsymb_TX_filled = [zeros(2*L,1); UPsymb_TX; zeros(2*L,1)];

conv_sig_TX = zeros(nb_sample+4*L,1);

for i=L+1:nb_sample+3*L
    tp_sum = 0;
    for j=-L:L
        tp_sum = tp_sum + UPsymb_TX_filled(i-j)*g(j+L+1);
    end
    conv_sig_TX(i) = tp_sum;
end
%[text] %[text:anchor:H_91CC9298] ### Vector cropping
%[text] The vector resulting from the convolution of the filter IR and the symbol stream contains zeros at its begining and its end. They should be removed to obtain the appropriate vector size of *\[ ( nb\_symb - 1 ) \* sps + length( g ) \] x 1*.
% Crop the resulting vector here
% tail = (nb_sample+2*L) - (nb_sample+Lg-1);
% signal = conv_sig_TX(tail/2 +1:end-tail/2);
signal = conv_sig_TX(L+1:nb_sample+3*L);
%[text] The size of the resulting signal, is equal to the upsampled stream PLUS the filter length - 1. There is therefore a tail at the begining and the end of the time domain vector introduced by the filter delay.
end

